Mongoose populate array is empty<p>I have defined a <code>UserSchema</code> and a <code>PostSchema</code> in my model.js. <code>UserSchema</code> has a ref to its own <code>Post</code>s, while <code>PostSchema</code> has a ref to its author.</p>

<p>In my <code>controllers.js</code> methods I'm creating a user and a post instance (bound to the newly created user). I'm now trying to populate the user's posts, but mongoose returns an empty array. However, the other way around works (I'm able to retrieve the user by a Post instance).</p>

<blockquote>
  <p>models.js</p>
</blockquote>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

const UserSchema = new Schema({
    username: String,
    posts: [{
      type: Schema.Types.ObjectId,
      ref: 'Post'
    }]
  })
const PostSchema = new Schema({
    content: String,
    author: {
      type: Schema.Types.ObjectId,
      ref: 'User'
    }
  })
const Post = mongoose.model('Post', PostSchema, 'posts');
const User = mongoose.model('User', UserSchema, 'users');

module.exports = { Post, User }
</code></pre>

<blockquote>
  <p>controllers.js</p>
</blockquote>

<pre><code>require('../model/db'); // DB config
const mongoose = require('mongoose');
const models = require('../model/models');

const getUser = (req, res) =&gt; {
        const user = new models.User({
            _id: new mongoose.Types.ObjectId(),
            username: 'JohnDoe'
        });

        user.save(function (err) {
            if (err) return res.json(err);

            const post = new models.Post({
                content: 'New Post',
                author: user.id
            });
        post.save(function (err) {
            if (err) return res.json(err);
            models.User.findOne({
                    username: 'JohnDoe'
                })
                .populate('posts').exec((err, user) =&gt; {
                    res.json(user);
                })
        });
    });
}

const getPost = (req, res) =&gt; {
        const user = new models.User({
            _id: new mongoose.Types.ObjectId(),
            username: 'JohnDoe'
        });

        user.save(function (err, user) {
                if (err) return res.json(err);

                const post = new models.Post({
                    content: 'NewPost',
                    author: user.id
                });

                post.save(function (err, post) {
                    if (err) return res.json(err);
                    models.Post.findOne({
                            content: 'NewPost'
                        })
                        .populate({
                            path: 'author',
                            model: 'User'
                        }).exec((err, user) =&gt; {
                            res.json(user);
                        })
                });

            });
}
</code></pre>

<blockquote>
  <p><code>getUser</code>'s result (posts is empty):</p>
</blockquote>

<pre><code>{
    "posts": [],
    "_id": "5b9426a6fd187d3949470f54",
    "username": "JohnDoe",
    "__v": 0
}
</code></pre>

<blockquote>
  <p><code>getPost</code> result (author is correctly returned)</p>
</blockquote>

<pre><code>{
    "_id": "5b94287e99072c3a173419f2",
    "content": "NewPost",
    "author": {
        "posts": [],
        "_id": "5b94287e99072c3a173419f0",
        "username": "JohnDoe",
        "__v": 0
    },
    "__v": 0
}
</code></pre>

