<pre><code>db.getCollection('task_groups').aggregate(
[
  {
    $match: {status: {$ne: 3}}
  },
  {
    $lookup: {
      from: 'tasks',
      localField: '_id',
      foreignField: 'taskGroupId',
      as: 'tasks'
    }
