<p>Array of tasks has a property "someoneAccountId". It's a ObjectId from "accounts" collection. How can I extend the pipeline to get an account for each "task"?</p>; Answer: When you delete in forward order you run the risk of deleting an item and all the items with indexes above the one you deleted shuffling down one. When you increment the counter in the loop and the shuffle happens you jump over items (leaving gaps in the sequence).
